const img = new Image();
img.src = 'data:image/png;base64,';

img.addEventListener('load', function(){
  const canvas = document.getElementById("canvas1");
  const ctx = canvas.getContext("2d");
  canvas.width = 1080;
  canvas.height = 840;

  let particlesArray = [];
  const numberOfParticles = 5000;
  const detail = 1;

  let centerX = canvas.width / 1.4;
  let centerY = canvas.height / 1.9;
  let gap = 2;
  let steps = 60;
  let increment = 2 * Math.PI / steps;
  let theta = increment;

  let rotation = 0;

  ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
  const imgData = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let grid = [];
  for (let y = 0; y < canvas.height; y+= detail){
    let row = [];
    for (let x = 0; x < canvas.width; x+= detail){
      const red = imgData.data[(y * 4 * imgData.width) + (x * 4)];
      const green = imgData.data[(y * 4 * imgData.width) + (x * 4 + 1)];
      const blue = imgData.data[(y * 4 * imgData.width) + (x * 4 + 2)];
      const color = 'rgb(' + red +',' + green + ',' + blue + ')';
      const brightness = calculateBrightness(red, green, blue)/100;
      const cell = [
        cellColor = color,
        cellBrightness = brightness,
      ];
      row.push(cell);
    }
    grid.push(row);
  }

  class Particle {
    constructor(){

      ctx.moveTo(this.x, this.y);
      this.x = centerX + theta * Math.cos(theta) * gap;
      this.y = centerY + theta * Math.sin(theta) * gap;
      ctx.lineTo(this.x,this.y);
      theta = theta + increment;
      this.rotation = rotation += 0.1;
      this.speed = 0;
      this.velocity = Math.random() * 0.5;
      this.size = Math.random() * 1.5 + 1;
      this.position1 = Math.floor(this.y / detail);
      this.position2 = Math.floor(this.x / detail);
      this.angle = 0;
    }
    update(){
      ctx.moveTo(this.position1, this.position2);
      this.position1 =  Math.floor(this.y / detail);
      this.position2 =  Math.floor(this.x / detail);
      //ctx.lineTo(this.position1,this.position2);

      if (grid[this.position1]){
        if (grid[this.position1][this.position2]){
            this.speed = grid[this.position1][this.position2][1];
        }
      }
      this.angle += this.speed/20;
        let movement = (2 - this.speed) + this.velocity;
        this.y -= movement + Math.sin(this.rotation) * gap;
        this.x += Math.cos(this.angle) * gap;
        if (this.y <= 0) {
            this.y = canvas.height;
            this.x = Math.random() * canvas.width;
        }

    }
    draw(){
       ctx.beginPath();
       ctx.fillStyle = 'black';
       if (this.y > canvas.height - this.size * 6) ctx.globalAlpha = 0;
       if (grid[this.position1]){
           if (grid[this.position1][this.position2]){
               ctx.fillStyle = grid[this.position1][this.position2][0];
           }

       } else {
           ctx.fillStyle = 'black';
       }
       ctx.arc(this.x, this.y, this.size, theta, 2 * Math.PI);
       ctx.fill();
    }
  }

  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particlesArray.push(new Particle);
    }
  }
  init();

  function animate(){
    ctx.globalAlpha = 0.11;
    ctx.fillStyle = 'rgb(0, 0, 0)';
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.10;
    for (let i = 0; i < particlesArray.length; i++){
      particlesArray[i].update();
      ctx.globalAlpha = particlesArray[i].speed * 0.5;
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();

  function calculateBrightness(red, green, blue){
    return Math.sqrt(
        (red * red) * 0.299 +
        (green * green) * 0.587 +
        (blue * blue) * 0.114
    );
  }
});
